def przerob_na_drzewo(T):
    from random import shuffle
    from random import seed
    seed(42)
    for i in range(len(T)):
        shuffle(T[i])
    ret = []
    for elem in T:
        tree = Tree()
        for el in elem:
            tree.insert(el)
        ret.append(tree)
    return ret

def traverse(root,nowa):
    if root == None:
        return None
    if root.left != None:
        traverse(root.left,nowa)
    nowa.append(root.val)
    if root.right != None:
        traverse(root.right,nowa)

def sprawdz(tr,odp):
    nowa = []
    traverse(tr.root,nowa)
    if len(nowa) != len(odp):
        print("Rozne dlugosci drzewa i odpowiedzi")
        return False
    if list(nowa) != list(odp):
        print("To sa rozne rzeczy o tej samej dlugosci")
        return False
    print("Wszystko git jest tu")
    return True



def runtests(f):
    i = 0
    for T,odp in G:
        i+=1
        drzewa = przerob_na_drzewo(T)
        if sprawdz(f(drzewa), odp):
            print("idzie dobrze dobrze chlopaki robia",i,"<- nr testu")
        else:
            print("To by nic nie dalo tu",i,"<- nr testu")
